# UTILITIES
def read_binary_file(fname):
    """Read in a binary file to a byte array."""
    with open(fname, "rb") as f:
        return bytearray(f.read())


def headtail(s, headlen, sep="\n..."):
    """Display a long string split between head and tail"""
    if len(s) <= 2 * headlen:
        return s
    outstr = s[:headlen] + sep + s[-headlen:]
    return outstr


def textwrap(text, width=64):
    """Simple textwrap to display string."""
    return "\n".join([text[i:i + width] for i in range(0, len(text) - 1, width)])


