def do_dsa_keygen_sign_verify_hedged(alg):
    """Generate a random keypair (pk, sk), compute a (hedged) signature over a message using sk with fresh randomness, then verify it using pk
    """
    print(f"\nTesting KeyGen-Sign-Verify for {crsyspqc.Dsa.alg_name(alg)} with fresh randomness ...")
    # Different keys each time (default use fresh randomness)
    pk, sk = crsyspqc.Dsa.keygen(alg)
    print("pk =", headtail(pk.hex(), 96))
    print("sk =", headtail(sk.hex(), 96))

    msg = b'abc'  # 0x616263
    print("msg =", msg.hex())

    # Sign the message (default "hedged" use fresh randomness)
    sig = crsyspqc.Dsa.sign(alg, msg, sk)
    print("sig =", headtail(sig.hex(), 96))

    # Verify the signature using the public key
    isok = crsyspqc.Dsa.verify(alg, sig, msg, pk)
    print("crsyspqc.Dsa.verify returns", isok)
    assert(isok)


def do_dsa_keygen_sign_verify_deterministic(alg):
    """Generate a random keypair (pk, sk), compute a (deterministic) signature over a message using sk, then verify it using pk
    """
    print(f"Testing KeyGen-Sign-Verify(deterministic) for {crsyspqc.Dsa.alg_name(alg)} ...")
    # Different keys each time (default use fresh randomness)
    pk, sk = crsyspqc.Dsa.keygen(alg)
    print("pk =", headtail(pk.hex(), 96))
    print("sk =", headtail(sk.hex(), 96))

    msg = b'abc'  # 0x616263
    print("msg =", msg.hex())

    # Sign the message using deterministic variant
    sig = crsyspqc.Dsa.sign(alg, msg, sk, crsyspqc.Dsa.SigOpts.DETERMINISTIC)
    print("sig =", headtail(sig.hex(), 96))

    # Verify the signature using the public key
    isok = crsyspqc.Dsa.verify(alg, sig, msg, pk)
    print("crsyspqc.Dsa.verify returns", isok)
    assert(isok)


