def do_dsa_keygen_known(alg, tcid, seed, pkok, skok):
    print(f"Testing DSA.keygen for {crsyspqc.Dsa.alg_name(alg)}: {tcid}...")
    print(f"seed={seed}")
    # Generate key pair with known seed
    pk, sk = crsyspqc.Dsa.keygen(alg, seed)
    print("pk =", headtail(pk.hex(), 96))
    print("sk =", headtail(sk.hex(), 96))
    # Check against known correct values
    assert pk.hex() == pkok.lower()
    assert sk.hex() == skok.lower()
    # Derive public key from private 
    pk1 = crsyspqc.Dsa.publickey_from_private(alg, sk)
    print("pk from sk   =", headtail(pk1.hex(), 32, "..."))
    assert pk.hex() == pk1.hex()

    if "ML-" in crsyspqc.Dsa.alg_name(alg):
        # For ML-DSA, check we can also recover the public key from the seed key
        # NB seed has been passed as a hex string - we need bytes
        pk1 = crsyspqc.Dsa.publickey_from_private(alg, bytes.fromhex(seed))
        print("pk from seed =", headtail(pk1.hex(), 32, "..."))
        assert pk.hex() == pk1.hex()


