def do_Kem_keygen_random(alg):
    print("ALG:", crsyspqc.Kem.alg_name(alg))
    # Generate a key pair using fresh randomness
    ek, dk = crsyspqc.Kem.keygen(alg)
    print("ek=" + headtail(ek.hex(), 96))
    print("dk=" + headtail(dk.hex(), 96))

    # Encapsulate - Use fresh randomness each time
    ss, ct = crsyspqc.Kem.encaps(alg, ek)
    print("ct=" + headtail(ct.hex(), 96))
    print("ss =", ss.hex())

    # Decapsulate
    ssd = crsyspqc.Kem.decaps(alg, ct, dk)
    print("ss'=", ssd.hex())
    assert(ss.hex() == ssd.hex())


def test_Kem_keygen_random_encap_decap():
    """Generate a random KEM keypair (ek,dk), encapsulate with ek to generate (ct, ss), then decapsulate ct using dk to get ss'"""
